import React, { useEffect, useRef } from 'react';
import { init } from "ityped";
import '../styles/Home.css';
import { motion } from 'framer-motion';
import { Container, Typography, Link, Grid, Box } from '@mui/material';
import BlueMoon from "../assets/BlueMoon.png";

function Home() {
    const textRef = useRef();

  // useEffect(() => {
  //   init(textRef.current, {
  //     loop: true,
  //     showCursor: true,
  //     backSpeed: 100,
  //     startDelay: 120,
  //     backDelay: 1700,
  //     strings: ["Student", "Developer", "Wonderer"],
  //   });
  // }, []);

  return (
    <section id="home">
      <Box className="header" sx={{ flexGrow: 6 }}>
        <Grid container alignItems="center">

        </Grid>
      </Box>

      <Container className="header">   
        <Container className="moon">
          <motion.img 
            src={BlueMoon} 
            alt="BLUE-MOON"
            initial={{ scale: 0 }}
            animate={{ scale: 1, rotate: [0, 360] }}
            transition={{ duration: 5, repeat: Infinity }}
            whileHover={{ scale: 1.1 }}
            whileTap={{ scale: 0.9 }}
          />
        </Container>     

            <Typography id="phrase" variant='h1'>
                A Sense of Wonder in A World Gone Mad
            </Typography>
      </Container>

      <Container className="intro">
        <Typography id="div" variant='h1'>
            Hi, my name is Tuka A. <br />
            {/* I'm a <span ref={textRef}></span> */}
        </Typography>
      </Container>

      <Container className="services">
        <Typography id="div" variant='h1'>
            What can I do for you?
        </Typography>
        <Typography id="div" variant='h2'>
            <ul>
                <li>Software Development</li>
                <li>Design</li>
                <li>Photography/Film</li>
                <li>Leadership</li>
            </ul>
        </Typography>
      </Container>

      <Container className="links">
        <Typography id="div" variant='h1'><Link to="/About">My work.</Link></Typography>
        <Typography id="div" variant='h1'><Link to="/About">About me.</Link></Typography>
      </Container>
    </section>
  );
}

export default Home;
